import React, { Dispatch, useState, useEffect } from "react";
import { connect } from "react-redux";
import { Button } from "primereact/button";
import { Dropdown } from "primereact/dropdown";
import { Checkbox } from "primereact/checkbox";
import { createBrowserHistory } from "history";
import FieldCreateData from '../../../assets/data/FieldCreateData.json';
import { Dialog } from "primereact/dialog";
import { ListBox } from 'primereact/listbox';
import '../../../../src/css/style.css';
import { getAllFields, getAllForms } from "../../../store/actions/TreatmentPlan";
import {
  TextField,
  FormControl,
  FormHelperText,
  Select,
  MenuItem,
  RadioGroup,
  FormControlLabel,
  Radio
} from "@mui/material";
import { HttpLogin } from "../../../utils/Http";
interface IAddFields {
  match:any;
  dispatch: Dispatch<any>;
  getAllFieldsData:any;
  getAllFormsData:any;
}
const AddFields: React.FC<IAddFields> = ({
  match, dispatch, getAllFieldsData, getAllFormsData
}) => {
  const history = createBrowserHistory();
  let [inputFormData, setInputFormData] = useState(FieldCreateData);
  let [encryptId, setEncryptId] = useState(null);
  let [decryptId, setDecryptId] = useState(null);
  let [allFormName, setAllFormName] = useState([]);
  let [inputOrgData, setInputOrgData] = useState("");
  useEffect(() => {

    var encryptIdInitial = match.params.name;
    var CryptoJS = require("crypto-js");
    setEncryptId(encryptIdInitial);
